import React, { Component } from "react";
import Container from "../components/Container";
import Form from "../components/Form";
import Jumbotron from "../components/Jumbotron";
import Nav from "../components/Nav";
import Results from "../components/Results-container";
import API from "../utils/API";
import axios from "axios"


class Search extends Component {
  state = {
    title: "",
    author: "",
    synopsis: ""
  }


  loadBooks = () => {
    const res = axios.get("https://www.googleapis.com/books/v1/volumes?q=pride+prejudice&download=epub&key=AIzaSyDFxWzjKG_NCl6Gzlrl2spI6ALqfhAhlPU")
    console.log(res);
  };
  render() {
    return (
      <div>
        <Nav />
        <Container>
          <Jumbotron />
          <Form onClick={this.loadBooks} />
          <Results />
        </Container>
      </div>
    )
  }
}

export default Search;
